import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Salary = () => {
  const [salaryData, setSalaryData] = useState([]);

  useEffect(() => {
    axios.get('/api/salary') // Make sure this matches your backend route
      .then((res) => setSalaryData(res.data))
      .catch((err) => console.error(err));
  }, []);

  const handleChange = (index, field, value) => {
    const updatedData = [...salaryData];
    updatedData[index][field] = value;
    setSalaryData(updatedData);
  };

  const handleUpdate = (id, data) => {
    axios.put(`/api/salary/${id}`, data)
      .then(() => {
        alert('Updated successfully');
        // Optional: reload data from server
      })
      .catch((err) => {
        console.error(err);
        alert('Update failed');
      });
  };

  return (
    <div className="salary-page">
      <h1>Employee Salary Details</h1>
      <table>
        <thead>
          <tr>
            <th>S.No</th>
            <th>Name</th>
            <th>Bank</th>
            <th>Account No</th>
            <th>IFSC</th>
            <th>Branch</th>
            <th>Days Worked</th>
            <th>Wage/Day</th>
            <th>Total Salary</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {salaryData.map((item, index) => (
            <tr key={item._id}>
              <td>{index + 1}</td>
              <td>
                <input
                  type="text"
                  value={item.name}
                  onChange={(e) => handleChange(index, 'name', e.target.value)}
                />
              </td>
              <td>
                <input
                  type="text"
                  value={item.bank}
                  onChange={(e) => handleChange(index, 'bank', e.target.value)}
                />
              </td>
              <td>
                <input
                  type="text"
                  value={item.accountNo}
                  onChange={(e) => handleChange(index, 'accountNo', e.target.value)}
                />
              </td>
              <td>
                <input
                  type="text"
                  value={item.ifsc}
                  onChange={(e) => handleChange(index, 'ifsc', e.target.value)}
                />
              </td>
              <td>
                <input
                  type="text"
                  value={item.branch}
                  onChange={(e) => handleChange(index, 'branch', e.target.value)}
                />
              </td>
              <td>
                <input
                  type="number"
                  value={item.daysWorked}
                  onChange={(e) => handleChange(index, 'daysWorked', e.target.value)}
                />
              </td>
              <td>
                <input
                  type="number"
                  value={item.wagePerDay}
                  onChange={(e) => handleChange(index, 'wagePerDay', e.target.value)}
                />
              </td>
              <td>{item.daysWorked * item.wagePerDay}</td>
              <td>
                <button onClick={() => handleUpdate(item._id, item)}>Update</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Salary;
